export default function Chosen() {
    return (
        <div className="col-5 col-md-5 Chosen">
            <h2 className="big">Your City</h2>
            <span><i className="fa-solid fa-rainbow big" /></span>
            <h2>
                <span>Temp </span>
                <span>33°C</span>
                <span> | </span>
                <span>88°F</span>
            </h2>
            <p>Mon 2:33PM</p>
            <p>Description</p>
            <p>Humidity</p>
            <p>Wind</p>
            <div>Last five days</div>
        </div>
    );
  }
